import React, { Component } from 'react';

class ToDoList extends Component {
  state = {
    todos: [
      {id : 1, description: "Lean React" },
      {id : 2, description: "Lean Java" },
      {id : 3, description: "Lean TypeScript" }
    ]
  };

  render() {
    return (
      <div>ToDoList</div>
    );
  }
}

export default ToDoList;
